const WooCommerceAPI = require('woocommerce-api');


  export default async (_req, res) => {
    const WooCommerce = new WooCommerceAPI({
        url: 'http://fleuriland.fr',
        consumerKey: 'ck_8cecfb224e1a6337bc5c978e57572c5d92166bf1',
        consumerSecret: 'cs_654a2f73fed125a745baa4ab032fbf6ef29b0482',
        wpAPI: true,
        version: 'wc/v1'
      });
    const result = await WooCommerce.getAsync('orders');
    res.json(result);
  };
